import React from 'react';
import './nav.css';

function Nav() {
  const showSubMenu = (element) => {
    const submenu = element.querySelector('.submenu');
    if (submenu) {
      submenu.classList.add("show");
    }
  };

  const hideSubMenu = (element) => {
    const submenu = element.querySelector('.submenu');
    if (submenu) {
      submenu.classList.remove("show");
    }
  };

  return (
    <div>
      <div className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top bg-primary">
        Unidad Familia Medellin
      </div>

      <div className="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top bg-white opacity-1" style={{ marginTop: '39px' }}>
        <div className="col-md-3 mb-2 mb-md-0">
          <img style={{ paddingLeft: '30px' }} width="150" height="100" role="img" src="https://cdnwordpresstest-f0ekdgevcngegudb.z01.azurefd.net/es/wp-content/uploads/2022/03/Open-Graph-.png" alt="" />
          <a href="/" className="d-inline-flex link-body-emphasis text-decoration-none"></a>
        </div>

        <nav className="nav col-md-4 mb-2 justify-content-center mb-md-0">
          <ul className="nav">
            <li>
              <div className="menu-item" onMouseOver={e => showSubMenu(e.target.parentElement)} onMouseLeave={e => hideSubMenu(e.target.parentElement)}>
                <a href="./" className="nav-link px-2">Inicio</a>
              </div>
            </li>
            <li>
              <div className="menu-item" onMouseOver={e => showSubMenu(e.target.parentElement)} onMouseLeave={e => hideSubMenu(e.target.parentElement)}>
                <a href="#" className="nav-link px-2">Â¿Quienes somos?</a>
                <div className="submenu text-center div1">
                  <label className="liT mb-2 "><a className="sub liT" href="#">Contactenos</a></label><br />
                  <label className="liT"><a className="sub liT" href="#">Unidad Familia</a></label>
                </div>
              </div>
            </li>
            <li>
              <div className="menu-item" onMouseOver={e => showSubMenu(e.target.parentElement)} onMouseLeave={e => hideSubMenu(e.target.parentElement)}>
                <a href="#" className="nav-link px-2">Noticias</a>
                <div className="submenu text-center div1">
                  <label className="liT mb-2 "><a className="sub liT" href="#">Contactenos</a></label><br />
                  <label className="liT"><a className="sub liT" href="#">SIOF</a></label>
                </div>
              </div>
            </li>
            <li>
              <div className="menu-item" onMouseOver={e => showSubMenu(e.target.parentElement)} onMouseLeave={e => hideSubMenu(e.target.parentElement)}>
                <a href="#" className="nav-link px-2">Multimedia</a>
              </div>
            </li>
          </ul>
        </nav>

        <div className="col-md-3 text-end">
          <button type="button" style={{ border: '1px solid #00B0F6', color: '#00B0F6' }} className="btn me-2 login">Login UFM</button>
          <button type="button" style={{ border: '1px solid #00B0F6', background: '#00B0F6' }} className="btn btn-primary">Login Admin</button>
        </div>
      </div>
    </div>
  );
}

export {Nav};
